import React from "react";

function Home(){
    return (
        <div>
            <div className="pageTitle">
                <div className="titleAndLogo">
                    <img className="logo" src={require("../imgs/logo.png")} alt="Fhilmhouse Logo" />
                    <p className="h1Title">FHILMHOUSE PRODUCTIONS</p>
                </div>
            </div>
        </div>
    );
}

export default Home;
